import React from "react";

export const NoMatchPage = () => {
  return (
    <div
      className="body-container"
    >
      <main className="main-body">
        <h1>404</h1>
        <p className="about">
          <strong>Страница не найдена</strong>.
        </p>
      </main>
    </div>
  );
};
